10 targets for 62 yards in the Cardinals' 28-21 loss to the Seahawks on Thursday night.\",\"analysis\":\"The legendary receiver turned in somewhat of a throwback effort, leading the Cardinals in receptions, receiving yardage and targets on the night despite DeAndre Hopkins playing the entire contest as well. Thursday's line happened to mirror the one Fitzgerald had put up against these same Seahawks back in Week 7, with the catches and yards serving as co-season bests and the target tally a new high-water mark for the 17-year veteran. Fitzgerald's production will undoubtedly continue to fluctuate week to week, but he now has at least four grabs and 54 receiving yards in three of his past four contests. He'll look to put together another solid performance in a Week 12 road matchup against the Patriots on Sunday, Nov. 29.\",\"title\":\"Vintage effort in defeat\"},{\"timeEpochMilli\":\"1605847823000\",\"contents\":\"Arizona Cardinals wide receiver Larry Fitzgerald has had an extremely quiet season overall, but he's made the most of his two matchups with the Seattle Seahawks. In Week 11, he caught eight of his team-high 10 targets for 62 yards. He also had exactly eight catches for 62 yards when the teams previously met in Week 7. Apart from those two games, Fitzgerald has only topped 50 yards in a game once. He's a deep PPR league flex option with low upside going forward. Don't chase this week's output.\",\"url\":\"https://www.rotoballer.com/player-news/larry-fitzgerald-leads-cardinals-in-receiving-in-week-11/806087\",\"title\":\"Larry Fitzgerald Leads Cardinals In Receiving In Week 11\"}],\"nameFirst\":\"Larry\",\"nameLast\":\"Fitzgerald\",\"proTeam\":{\"abbreviation\":\"ARI\",\"location\":\"Arizona\",\"name\":\"Cardinals\"},\"positionEligibility\":[\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6299,\"away\":{\"abbreviation\":\"ARI\",\"location\":\"Arizona\",\"name\":\"Cardinals\"},\"home\":{\"abbreviation\":\"SEA\",\"location\":\"Seattle\",\"name\":\"Seahawks\"},\"